import React from "react";
import "./nav.css";
import "../assets/images/home";
const Nav=()=>{
    return(
        <nav>
            <ul>
                <li>Home <img src="" /></li>
                <li>Connections</li>
                <li>Search</li>
                <li>Notifications</li>
                <li>Profile</li>
            </ul>
        </nav>
    )
}
export default Nav;
